  special_subtitle1: "Piyasa 9:30'da açılmadan önce, zm'nin hisse senedi fiyatının gün içinde nasıl hareket edeceğini tahmin etmek için çeşitli veriler kullanıyoruz. \r\n2020'de zm'nin hisse senedi fiyatına bağlanan ve günlük hareketlerin benzersiz doğası nedeniyle verileri almaya karar veren kişilerden biriydim. \r\n7'den fazla yapay zeka sertifikam var, bu nedenle yapay zeka modeli üzerinde bir model analizi yapmak için mükemmel bir veriydi. \r\nBunu, tam olarak hangi fiyattan almam ve hangi fiyattan satmam gerektiğine dair 6 desen ve 8 seviye tahmin eden bir model oluşturmak için kullandım. \r\nBu yapay zeka modeli, günde en az bir kez satış ve alış işlemlerini tekrarlayacak şekilde tasarlanmıştır. \r\nHisse senedi fiyatının nasıl hareket edeceğini bilmek güzel olmaz mıydı? Hiç bir bankanın perakende sektörü ile aynı oyun alanında rekabet etmek istediniz mi? Bu bilet dileğinizi gerçekleştirecek.",
  special_link_title1: 'AI modeli girdi değerleri için buraya tıklayın.',
  special_link_url1: 'https://tickets-onchain.com/ti/zmi',
  special_link_title1_2: 'Yapay zeka modeli oluşturma RandamForest metodolojisi kullanılarak yapılır. Nasıl oluşturulduğunu görmek için lütfen Kaggle sitesini buradan ziyaret edin.',
  special_link_url1_2: 'https://www.kaggle.com/code/takashitahara/new-stock-expected-move-analysis',
  special_link_title1_3: 'İşte düne kadar yapılan tüm tahminlerin tam sonuçları ve yapay zekanın gerçek verilere dayanarak tahmin etmesi gereken modellerin tam sonuçları',
  special_link_url1_3: 'https://tickets-onchain.com/ti/our_stats?link=c6809a3ad0',
  special_additional1_type1_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 1'dir.",
  special_additional1_type1_post: "Tip 1'de, hisse senedi fiyatı bir önceki güne göre daha düşük olacaktır, ancak gün içinde biraz daha yükselmesi beklenmektedir. Bu nedenle, dipten alım yapmak ve bu yüksek fiyattan satış yapmak karlı olacaktır.",
  special_additional1_type2_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 2'dir.",
  special_additional1_type2_post: "Tip 2'nin 10:30 ~ 11:00 civarında çok yükselmesi bekleniyor. Yani 9:30 civarında bir önceki güne göre +1%'den daha düşük bir fiyata satın alabilirseniz, daha yüksek bir fiyata sattığınızda kar edebilirsiniz.",
  special_additional1_type3_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 3'dir.",
  special_additional1_type3_post: "Tip 3'ün hisse senedi fiyatının 9:45 ~ 10:00 civarında yükselmesi, ancak daha sonra düşmesi bekleniyor. Dolayısıyla, 9:30 civarında bir önceki güne göre %1'den daha düşük bir fiyata satın alabilirseniz, daha yüksek bir fiyata sattığınızda kar elde edebilirsiniz.",
  special_additional1_type4_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 4'dir.",
  special_additional1_type4_post: "Tip 4, yaklaşık 9:35'te gün içinde ancak pozitif bir kazanç sağlayacaktır, ancak bundan sonra keskin bir şekilde düşmesi beklenmektedir. Bu nedenle, keskin bir düşüş noktasında alım yapın ve fiyat daha yüksek bir seviyeye döndüğünde satış yapın. Bunu yaparak kâr elde edeceksiniz.",
  special_additional1_type5_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 5'dir.",
  special_additional1_type5_post: 'Tip 5 için piyasa çok çetin. Belki de 9:30 yapabileceğiniz en yüksek fiyat olarak kabul edilir. Gün içi dipten alıp yüksekten sattığımız düşünülürse alım yapmak mümkün ama satmak için neredeyse hiç zaman yok.',
  special_additional1_type6_pre: "Bugünkü hisse senedi fiyat tahmininin sonucu Tip 6'dir.",
  special_additional1_type6_post: 'Tip 6, ZOOM için piyasada nispeten ucuz ve hisse senedi fiyatının öğleden sonra yükseleceği düşünülüyor. Sabah dipten alıp öğleden sonra yüksekten sattığınızda kâr elde edebilirsiniz.',
  special_additional1_from_pre: 'Tahmini satın alma fırsatı (dip fiyat) sonucu:',
