  special_additional1_bottom_1: 'Gün içi en düşük fiyattan alım ve gün içi en yüksek fiyattan satış düşünüldüğünde, en düşük fiyatın AI modelinin tahmin sonuçlarındaki sekiz seviyenin en düşük fiyatı olması beklenir',
  special_additional1_bottom_2: 'Dip fiyatın, AI modelinin tahmin sonuçlarındaki sekiz seviyenin en düşük ikinci fiyatı olması bekleniyor. Bugün hisse senedi fiyatlarında düşüş eğilimi öngörülmektedir ve bu seviyede geçici bir dip oluşması beklenmektedir.',
  special_additional1_bottom_3: "Yapay zeka modeli, zm'nin hisse senedi fiyatının bugün sabitlenmeyeceğini ve önceki günden itibaren pozitif ve negatif bölge arasında gidip geldiğini, ancak dibin bu fiyatta olabileceğini öngörüyor.",
  special_additional1_bottom_4: "Gün içi en düşük seviyelerden alım ve gün içi en yüksek seviyelerden satış düşünüldüğünde, bugün dip seviyenin çok fazla düşmesi beklenmiyor, ancak dip seviyenin bir önceki güne göre % -2,2'den daha düşük olması bekleniyor.",
  special_additional1_bottom_5: "Gün içi en düşük seviyelerden alım ve gün içi en yüksek seviyelerden satış düşünüldüğünde, bugün dip seviyenin fazla düşmesi beklenmiyor, ancak dip seviyenin bir önceki güne göre %-1,6'dan daha düşük olması bekleniyor.",
  special_additional1_bottom_6: "AI'nın tahmini sonucu, bugünün bir önceki günden daha düşük olmayacağı, ancak dip seviyenin bir önceki günün kapanışının -%0,8 altında olması bekleniyor.",
  special_additional1_bottom_7: "AI'nin tahmin sonuçlarına göre, piyasanın bugün tüm gün yükselişini sürdürmesi ve dip seviyenin bir önceki güne göre yaklaşık +%0,2 olması bekleniyor ve bu muhtemelen sabahın erken saatlerinde kısa bir an olacak.",
  special_additional1_bottom_8: 'Gün içi en düşük seviyelerden alım ve gün içi en yüksek seviyelerden satış göz önünde bulundurulduğunda, AI tahmin sonuçları, fiyat trendinin bugün tüm gün boyunca çok yükselişte kalacağını ve dip seviyenin düşmesinin beklendiğini, ancak bunun sadece yaklaşık% 1,0 oranında ve sadece anlık olarak olacağını öngördü.',
  special_additional1_high_1: "Gün içi en düşük seviyelerden alım yaptığımız ve gün içi en yüksek seviyelerden satış yaptığımız göz önüne alındığında, AI'nın öngördüğü sonuçlar, bugünkü fiyat hareketinin gün boyunca çok düşüş eğilimli kalmasının beklendiği ve düşük seviyelerden çok az veya hiç yükseliş olmayacağı anlamına geliyor. (Kapanıştan önce negatif değilse satış yapmanızı öneririz).",
  special_additional1_high_2: "Gün içi en düşük seviyelerden alım yaptığımız ve gün içi en yüksek seviyelerden satış yaptığımız göz önüne alındığında, AI bugün düşüş eğilimli bir fiyat hareketi olacağını, en düşük seviyelerin çok daha düşük olacağını ancak en yüksek seviyelerin %1,2'ye kadar yükseleceğini ve en düşük ve en yüksek seviyeler arasındaki farktan karlı olacağını öngördü.",
  special_additional1_high_3: "Gün içi en düşük seviyelerde alım ve gün içi en yüksek seviyelerde satış yaptığımız göz önüne alındığında, AI'nın öngördüğü sonuçlar bugün düşüş eğilimi olduğu, ancak zamanlamanın düşük seviyelerden -%0,5'e dönmesinin beklendiği anlamına geliyor.",
  special_additional1_high_4: "Gün içi dip seviyeden alım yaptığımız ve gün içi en yüksek seviyeden satış yaptığımız göz önüne alındığında, AI'nın öngördüğü sonuç, bugünün fiyat hareketinin düşüş eğiliminde olmasının beklendiği anlamına gelir, yani fiyatın dip seviyeden sonra yükselmesi, ancak pozitif olduktan kısa bir süre sonra düşmesi beklenir. (Negatiften pozitife psikolojik olarak bir etkisi olduğu düşünülmektedir)",
